import React from 'react';
import './App.css';
import Head from './UI/Head.jsx';
import Dash from './UI/Dash.jsx';
import Display from './UI/Display.jsx';
import Content from './UI/Content.jsx';

function App() {
  return (
    <div className="container-fluid row">

       <div className="First container">
       <Head/>
       <Dash/>
       </div>

       <div className="Second container">
       <Display/>
       <Content/>
       </div>

    </div>
  );
}

export default App;
